-- DROP DATABASE IF EXISTS cavatable_photos;

CREATE DATABASE cava_table;

USE cava_table;

CREATE TABLE cavatable_photos (
  id int(100) NOT NULL,
  url varchar(255) NOT NULL,
  description varchar(255),
  date date,
  source varchar(255),
  restaurant_id int,
  PRIMARY KEY(id)
);


